        public void getCreateSummary(String ProjectName, String strExecutionPath, String SuiteType) throws Exception{
            
        	String strDetailReportsPath="./Detailed Reports/" + strExecutionPath;        	
        	File directory = new File(strDetailReportsPath);
        	File[] fList = directory.listFiles();
            int intPassCount=0, intFailCount=0, intExecutionCount=0;
            Document doc = null;
            String flags = null;
            StringBuffer sbHTML = new StringBuffer();
            for (File file : fList){
                String strFileName = file.getName();
                doc = Jsoup.parse(file, "UTF-8");
                Elements elementsStatus = doc.select("td#Status");
                String DetailReportfilePath="./"+strFileName;
                String strStartTime = doc.select("td#StartTime").first().text();
                String strEndTime = doc.select("td#EndTime").first().text();
                String strExecTime = doc.select("td#ExecutionTime").first().text();
                String strTestcaseName = doc.select("td#TestCaseName").first().text();                                  
                for(Element eleStatus :elementsStatus){
                	String strStatus = (eleStatus.select("td#Status").first().text());
                    if(strStatus.equalsIgnoreCase("pass")){
                    	flags ="Pass";
                    }
                    else{
                    	flags="Fail";
                        break;
                    }                                                             
                }
                if (flags=="Pass"){
                    intPassCount = intPassCount+1;
                }else if(flags=="Fail"){
                	intFailCount = intFailCount+1;
                }    
                
                sbHTML.append("    <tr>"
                              +"      <td>1</td>"
                              +"      <td>"+strTestcaseName+"</td>"
                              +"      <td>"+strStartTime+"</td>"
                              +"      <td>"+strEndTime+"</td>"
                              +"      <td>"+strExecTime+"</td>"
                              +"      <td><a href='"+DetailReportfilePath+"'>"+flags+"</a></td>"
                              +"   </tr>");
                
                sumExecutionTime(strExecTime);                
            }
            intExecutionCount = intPassCount+intFailCount;

            int[] arrStatus = {intPassCount, intFailCount, intExecutionCount};
            
            createSummaryReport(ProjectName, SuiteType, strExecutionPath, sbHTML, arrStatus);
        }
		
